import styled from 'styled-components';

const Header = styled.span`
  font-size: 50px;
`;

function App() {
  return (
    <>
      <Navbar />
      <div>
        <Header>진짜 맛집</Header>
      </div>
      <Searchbar />
    </>
  );
}

export default App;
